    group: List[int] = []
    level: int = 0
    for char in paren_string:
        if char == '(':
            group.append(level)
            level += 1
        elif char == ')':
            group.append(level)
            level -= 1
        elif char == ',':
            if level == 0:
                raise ValueError('Incorrect nested parens group.')
            else:
                group.append(level)
                level -= 1
        elif char =='':
            pass
        else:
            raise ValueError('Incorrect nested parens group.')
    return group

